    in the North Atlantic Ocean from 2014-05-09 to 2014-11-05. These data include CONDUCTIVITY,
    HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE.
